import ProductDetail from "./ProductDetail";

abstract class Item {
  id: number;
  title: string;
  price: number;
  pictureUrl: string;
  productDetail: ProductDetail;

  constructor(id: number, title: string, price: number, pictureUrl: string, productDetail: ProductDetail) {
    this.id = id;
    this.title = title;
    this.price = price;
    this.pictureUrl = pictureUrl;
    this.productDetail = productDetail;
  }

}

export default Item;
